import React from 'react';
import './title.css'

class Title extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div>
      <div id="logohead" className="col-12">
        <h1 className="display-3 text-center font-weight-bolder">
        {props.logo_head}
        </h1>
      </div>
      <div className="slogan text-center col-12">
          <h2 id="slogan">{props.slogan}</h2>
      </div>
      </div>
    );
  }
}
export default Title
